    label: 'About'
  },
  artwork: {
    // to: '/About',
    label: 'Artwork',
    subItems: [
      {
        to: '/artwork/2019',
        label: '2019 - now'
      },
      {
        to: '/artwork/2018-2019',
        label: '2018-2019'
      },
      {
        to: '/artwork/earlier-works',
        label: 'Earlier Works'
      }
    ]
  },
  contact: {
    to: '/connect',
    label: 'Connect'
  }
}

export default navItems
